import React from "react";
import HeaderMain from "../../components/HeaderMain/HeaderMain";
import More from "../../images/more.svg";

function Feed() {
  return (
    <div>
      <HeaderMain />
      <div className="cards">
        <header>
          <h2>Curso consumindo Api</h2>
          <img src={More} alt="circle"></img>
        </header>
      </div>
    </div>
  );
}

export default Feed;
